import {
  useTheme,
  useMediaQuery,
  Grid,
  Button,
  Stack,
  Typography,
  IconButton,
} from "@mui/material";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";

export const ProfileDetails = () => {
  const theme = useTheme();
  const matches = useMediaQuery(theme.breakpoints.up("md"));
  const widthCalc = `calc(100vw - ${matches ? "200" : "75"}px)`;
  return (
    <Grid container>
      <Grid
        width={widthCalc}
        justifyContent={"center"}
        alignItems={"center"}
        item
        container
      >
        <Grid
          sm={8}
          item
          container
          justifyContent={"space-around"}
          direction={"row"}
          spacing={1}
        >
          <Grid sm={2} item container justifyContent={"center"}>
            <IconButton color={"primary"}>
              <AccountCircleIcon sx={{ fontSize: "100px" }} />
            </IconButton>
          </Grid>
          <Grid sm={8} item>
            <Stack direction="column">
              <Typography color={"#fff"} variant={"h4"}>
                Dr. Stephen Strange
              </Typography>
              <Typography color={"#ddd"} variant={"subtitle1"}>
                @drstrange
              </Typography>
            </Stack>
          </Grid>
          <Grid sm={2} item>
            <Button
              sx={{ borderRadius: "20px" }}
              color={"primary"}
              variant="outlined"
            >
              Edit Profile
            </Button>
          </Grid>
        </Grid>
        <Grid sm={4} item container justifyContent={"center"}>
          <Button>Right Nav</Button>
        </Grid>
      </Grid>
      <Grid item ml={2.5}>
        <Typography variant="body1" color="#fff">
          MD. Sorcerer Supreme. Avenger.
        </Typography>
      </Grid>
      <Grid item ml={2.5}>
        <Stack direction="row"></Stack>
      </Grid>
    </Grid>
  );
};
